import React from "react";
import { Grid, Typography } from "@material-ui/core";

const WelcomePage = () => {
	return (
		<Grid>
			<Typography variant="h2">Welcome to KitchenMenu!</Typography>
		</Grid>
	);
};

export default WelcomePage;
